callback_with_context.context_function_id:
(head = Component("snake_pieces").ChildList[0],
 apple = Component("apples").ChildList[0],
 reverse_list = Component("snake_pieces").ChildList.Reverse,
 tail_x = reverse_list.LastContext.RelativePosition.x,
 tail_y = reverse_list.LastContext.RelativePosition.y) => {
  DoIf(ToNumber(self.GetProperty("game_over")) == 0,
  reverse_list[0:reverse_list.Size - 1].ForEach(
      (c, n = reverse_list.NextContext(c)) => c.SetDockOffset(n.RelativePosition.x, n.RelativePosition.y)
    );

  head.SetDockOffset(
    head.RelativePosition.x + ToNumber(self.GetProperty("snake_move_x")),
    head.RelativePosition.y + ToNumber(self.GetProperty("snake_move_y")));

  DoIf(
    head.RelativePosition.x == apple.RelativePosition.x && head.RelativePosition.y == apple.RelativePosition.y,
    CreateComponent("ui/dev_ui/snake/snake", Component("snake_pieces")); 
    Component("snake_pieces").ChildList.LastContext.SetDockOffset(tail_x, tail_y);
 Component("snake_pieces").ChildList.LastContext.SetState("tail");
    self.SetProperty("score", ToNumber(self.GetProperty("score")) + 1);
    UiMsg("EatApple")
  );

  DoIf(
    head.RelativePosition.x < 0 || 
      head.RelativePosition.y < 0 || 
      head.RelativePosition.x > (512-32) || 
      head.RelativePosition.y > (512-32) ||
      Component("snake_pieces").ChildList[1:].Any(RelativePosition.x == head.RelativePosition.x && RelativePosition.y == head.RelativePosition.y),
    Component("game_over_state").SetVisible(true);
    self.SetProperty("game_over", 1))

)}

(manager = Component("manager"),
  max_spaces = (512 / 32) - 1,
  space_x = TrueRandomInRange(0, max_spaces),
  space_y = TrueRandomInRange(0, max_spaces)) => {

  self.SetDockOffset(space_x * 32, space_y * 32)

}
